import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBIcon,
  MDBCol,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText
} from "mdbreact";
import Band from './band';
import Singer from './singer';
import Dance from './dance';
import Beats from './beats';
import AlumniTeam from './alumniteam';
import Comedy from './comedy';
import band from './band.png';
import dance from './music.png';
import comedy from './stage.png';
import beats from './bot.png';
import alumni from './team.png';
import sing from './singer.png';


class Testimonials extends React.Component {
    render() {
        return(
            <MDBContainer className="mt-5 p-3" >
            <div>
            
     
          
            <h2>Events</h2>
            <br/><br/>
                <MDBRow align="center">
              <MDBCol md="4" lg="4" sm="5"><Band/></MDBCol>
              <MDBCol md="4" lg="4" sm="5"><AlumniTeam/></MDBCol>
              <MDBCol md="4" lg="4" sm="5"><Singer/></MDBCol>
            
              </MDBRow>
<br/>
              <MDBRow align="center">
              <MDBCol md="4" lg="4" sm="6"><Dance/></MDBCol>
              <MDBCol md="4" lg="4" sm="6"><Beats/></MDBCol>
              <MDBCol md="4" lg="4" sm="6"><Comedy/></MDBCol>
             
              </MDBRow>
           
                <br/><br/>
            
            </div>
            </MDBContainer>
        );
    }
}

export default Testimonials;
